import './App.css';
import {Container, Col, Row } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <>
    <Container>
      <Row>
        <Col>
        Hello world
        </Col>
      </Row>
    </Container>
    </>
  );
}

export default App;
